#define MAX_WIDTH 236
#define FINAL_R 20
#define EPS_DOUBLE (2.2204e-16)
double pMat[MAX_THREAD_NUM][MAX_WIDTH*MAX_HEIGHT];
double pbMat[MAX_THREAD_NUM][MAX_WIDTH*MAX_HEIGHT];
