bool IsPreProcessed = false;

int rref(double * A, int m, int n, int threadID) // m:H,n:W
{
    // Norm-inf
    double MaxSumRow = 0, SumRow;
    for (int ii = 0; ii < m; ++ii){
        int index = ii * n;
        SumRow = 0;
        for (int jj = 0; jj < n; ++jj){
            SumRow += fabs(A[index + jj]);
        }
        if (MaxSumRow < SumRow){
            MaxSumRow = SumRow;
        }
    }

	double tol = MAX_WIDTH * EPS_DOUBLE * MaxSumRow;
    double * bMat = pbMat[threadID];

	int i = 0;
	int j = 0;
	while ((i < m) && (j < n)){	
		int k = i;
		double p = fabs(A[i*n + j]);
		for (int ii = i + 1; ii < m; ++ii){
			if (p < fabs(A[ii*n + j])){
				p = fabs(A[ii*n + j]);
				k = ii;
			}
		}

		if (p <= tol){ // tol
			for (int ii = i; ii < m; ++ii){
				A[ii*n + j] = 0;
			}
			j += 1;
		}
		else{
			if (i != k)	{
				// Swap i-th and k-th rows.
				double tv;
				for (int jj = j; jj < n; ++jj){
					tv = A[i*n + jj];
					A[i*n + jj] = A[k*n + jj];
					A[k*n + jj] = tv;
				}
			}

			for (int jj = n - 1; jj >= j; --jj){
				A[i*n + jj] = A[i*n + jj]/A[i*n + j];
			}

            memcpy(bMat, A, n*m*sizeof(double));
			for (int k = 0; k < m; ++k){
				if (k == i){
					continue;
				}
				for (int jj = j; jj < n; ++jj){
					A[k*n + jj] = bMat[k*n + jj] - bMat[k*n + j]*bMat[i*n + jj];
				}
			}

			i = i + 1;
			j = j + 1;
		}
	}
    return 0;
}

